function execute() {
    var n = '';

    var max = 0;
    for (var i = 12; i < n.length; i++) {
        var product = 1;
        for (var j = i - 12; j <= i; j++) {            
            product *= Number(n[j]);
            if (product === 0)
                break;
        }
        if (product > max) 
            max = product;
    }

    return max;
}
module.exports.execute = execute;